class Solution(object):
    def longestValidSubstring(self, word, forbidden):
        max_len = 0
        start = 0
        for end in range(len(word)):
            if any(word[start:end+1].find(f) != -1 for f in forbidden):
                start += 1
            else:
                max_len = max(max_len, end - start + 1)
        return max_len
